FeedPackage.Description:
基于键值对形式的二进制数据包生成解析工具, 方便在网络上传输数据.
byte[] pkt = new PacketWriter().Push("id", 0).Push("text", "hello").GetBytes();
var res = new PacketReader(pkt);
Console.WriteLine(res.Pull<int>("id"));
Console.WriteLine((string)(res as dynamic).text);

