源代码 github.com/c1f5d1ef/data-packet

基于键值对形式的二进制数据包生成解析工具, 方便在网络上传输数据.
A binary packet generation tool based on key-value pair form, designed for transmission of data over network.

Read write sample:
byte[] pkt = new PacketWriter().Push("one", "hello").GetBytes();
string str = new PacketReader(pkt).Pull<string>("one");

Dynamic sample:
var som = (dynamic)new PacketWriter();
som.list.value = 1234;
var res = (dynamic)new PacketReader((byte[])som.GetBytes());
int val = (int)res.list.value;

